import React, { Component } from 'react';
function Menu(){
 return (
 <p>
 Menu:
 <ul>
 <li><a href="/profile">Profile</a></li>
 <li><a href="/proyek">Proyek</a>
 <ul>
 <li><a href="/proyek/web-app">Web App</a></li>
 <li><a href="/proyek/mobile-app">Mobile App</a></li>
 </ul>
 </li>
 </ul>
 </p>
 );
}
class Proyek extends Component{
 render(){
 return (
 <div>
 <h1>Produk</h1>
 <p>Berikut adalah daftar produk yang kami sediakan:</p>
 <ul>
 <li><a href="/proyek/web-app">Galeri Produk</a></li>

 </ul>
 <hr />
 <Menu />
 </div>
 )
 }
}
export default Proyek;
